package com.example.lee.firstRound;

import java.util.*;

/**
 * Created by benbendaisy on 3/8/15.
 *
 * All DNA is composed of a series of nucleotides abbreviated as A, C, G, and T, for example: "ACGAATTCCG". When studying DNA, it is sometimes useful to identify repeated sequences within the DNA.
 *
 * Write a function to find all the 10-letter-long sequences (substrings) that occur more than once in a DNA molecule.
 *
 * For example,
 *
 * Given s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT",
 *
 * Return:
 * ["AAAAACCCCC", "CCCCCAAAAA"].
 */
public class RepeatedDNASequences {

    // cannot pass all tests, time complexity o(n ^ 2)
    public List<String> findRepeatedDnaSequences(String s) {
        List<String> list = new ArrayList<String>();
        if (null == s || s.length() < 10) {
            return list;
        }

        Set<String> set = new HashSet<String>();
        for (int i = 0; i < s.length() - 10; i++) {
            String str = s.substring(i, i + 10);
            if (checkMoreThanTwice(s, str)) {
                set.add(str);
            }
        }

        list.addAll(set);
        return list;
    }

    private boolean checkMoreThanTwice(String s, String str) {
        int idx = s.indexOf(str);
        if (idx == -1) {
            return false;
        } else {
            return s.indexOf(str, idx + 1) == -1 ? false : true;
        }
    }

    //basic ideas are changing characters to two digits integer and operate on integer bits
    // A:00, B:01, C:10, D:11
    public List<String> findRepeatedDnaSequencesI(String s) {
        List<String> list = new ArrayList<String>();
        if (null == s || s.length() < 10) {
            return list;
        }

        //must use set to eliminate duplication
        Set<String> set = new HashSet<String>();
        Set<Integer> iSet = new HashSet<Integer>();
        Map<Character, Integer> map = new HashMap<Character, Integer>();
        map.put('A', 0);
        map.put('C', 1);
        map.put('G', 2);
        map.put('T', 3);

        int hash = 0;
        //initial the hash key
        for (int i = 0; i < 10; i++) {
            hash = (hash << 2) + map.get(s.charAt(i));
        }

        iSet.add(hash);

        for (int i = 10; i < s.length(); i++) {
            //generate new hash key
            hash = (hash << 2) + map.get(s.charAt(i));
            //get lower 20 digits
            hash &= (1 << 20) - 1;
            //check if there is more than two same hash codes
            if (!iSet.add(hash)) {
                set.add(s.substring(i - 9, i + 1));
            }
        }

        list.addAll(set);
        return list;
    }

    public static void main(String[] args) {
        RepeatedDNASequences repeatedDNASequences = new RepeatedDNASequences();
        System.out.println(repeatedDNASequences.findRepeatedDnaSequences(""));
        System.out.println(repeatedDNASequences.findRepeatedDnaSequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"));
    }
}
